, landscapes - get a groovy combination for your room. Use our virtual room preview below to test out the combinations before you buy. Select the design and colour you like and click buy.','','','',0,''),(14,2,'limited_rares','Limited Rares','default_3x3',1,145,1,15,'1','1','0','0','limited_header','catalog_limited_teaser_en','','These are only available for a limited time!','','','',0,''),(16,604,'lighting','Lighting','default_3x3',1,115,1,25,'1','1','0','0','catalog_dimmers_header1_en','catalog_dimmer_teaser_en','','Check out the Mood Lights. Use these items to dim the light in your rooms. Try out different light settings with different wallpapers to see what you get. Talk about lighting with style!',NULL,NULL,'',0,''),(17,209,'mode','Mode','default_3x3',1,39,1,130,'1','1','0','0','catalog_mode_headline1','catalog_mode_teaser1','','Steely functionality combined with a sleek designer upholstery. The Habbo who chooses this furniture is a cool urban cat - streetwise, sassy and so slightly untouchable.','','','',0,''),(18,209,'lodge','Lodge','default_3x3',1,37,1,120,'1','1','0','0','catalog_lodge_headline1','catalog_lodge_teaser1','','For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.','','','',0,''),(20,604,'vegetation','Plants','default_3x3',1,220,1,35,'1','1','0','0','catalog_plants_headline1','catalog_plants_teaser1','','Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful rose or elegant fruit tree...','','','',0,''),(21,604,'walls','Gallery','default_3x3',1,219,1,20,'1','1','0','0','catalog_gallery_headline1','catalog_posters_teaser1','','Bring the outdoors in with windows and posters. Transform your surroundings - your walls will never look bare again!','','','',0,''),(22,604,'accessories','Accessories','default_3x3',1,11,1,-1,'1','1','0','0','catalog_extra_headline1','catalog_extra_teaser1','','However you place your essential Furniture, it\'s the finishing touches that count!','','','',0,''),(23,526,'pixel_rentals','Ducket Rentals','default_3x3',1,178,1,7,'1','1','0','0','rental10','pixel3','','','','','',0,''),(24,209,'base','Base','default_3x3',1,179,1,26,'1','1','0','0','catalog_header_base','base_rentable_teaser','','Don\'t have enough credits? Base Furni is just for you! This colourful range of furni has everything you need to style out your room and build great spaces.','','','',0,''),(25,604,'badge_display','Badge Display','badge_display',1,224,1,5,'1','1','0','0','catalog_header_badgedisplay','badgedisplay_promo2','','You worked hard to get your badges, right? Now\'s the time to show it off, grab a display case and choose your favorite badge to show off!','','','',0,''),(26,2,'room_event','Room Event','roomads',1,225,1,10,'1','1','0','0','events_header','','','','','','',0,''),(27,209,'iced','Iced','default_3x3',1,72,1,106,'1','1','0','0','catalog_iced_headline1','catalog_iced_teaser1','','It\'s so chic, it says everything and nothing. It\'s a blank canvas, let your imagination run wild!','','','',0,''),(28,209,'alhambra','Alhambra','default_3x3',1,12,1,4,'1','1','0','0','alhambra_header','alhambra_teaser1','','For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!','','','',0,''),(29,209,'glass','Glass','default_3x3',1,29,1,76,'1','1','0','0','catalog_glass_headline1','catalog_glass_teaser1','','You can really open up a space with this stylish glass furniture, just don\'t walk into it!','','','',0,''),(30,209,'gothic','Gothic','default_3x3',1,30,1,78,'1','1','0','0','catalog_gothic_headline1','catalog_gothic_teaser1','','As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!','','','',0,''),(31,209,'japan','Japan','default_3x3',1,36,1,110,'1','1','0','0','catalog_jap_headline1','catalog_jap_teaser3_en','','We have sushi, tatami and katana\'s! I have no idea what the difference is, but I sure know its Japanese! Fulfil your fantasies and buy some today!','','','',0,''),(32,209,'lost_tribe','Lost Tribe','default_3x3',1,38,1,124,'1','1','0','0','losttribe','LT_teaser_br','','Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.','','','',0,''),(33,209,'neon','Neon','default_3x3',1,41,1,140,'1','1','0','0','catalog_neon_header1_en','catalog_neon_teaser1_en','','Party animals rejoice! Feel the base and reach for the lasers with the Neon Furni range - everything you need to get the party started!','','','',0,''),(34,209,'relax','Relax','default_3x3',1,49,1,164,'1','1','0','0','relax_header','rela_teaser_en','','Relax after a busy day in the Welcome Lounge. Light a few candles, and chill out with a good read in a wicker chair. We understand the needs of a Wulles with a hectic lifestyle!','','','',0,''),(35,209,'romantique','Romantique','default_3x3',1,50,1,166,'1','1','0','0','catalog_romantique_headline1','catalog_rom_teaser_en','','Found in a French barn, this sweet but sexily romantic range caters to every ladies needs. Just going to powder my nose!','','','',0,''),(36,209,'scifi','Sci-Fi','default_3x3',1,53,1,174,'1','1','0','0','sf_header_en','sf_teaser_en','','Sci Fi convention, outer space, the Moon, we have everything you need to make your own mystical, un-earthly room right here!','','','',0,''),(37,209,'2009_shalimar','Shalimar','default_3x3',1,54,1,176,'1','1','0','0','catalog_shal_header1_en','catalog_shal_teaser_en','','Everyone loves Bollywood! Watch out for those falling rose petals!','','','',0,''),(38,219,'freeze!','Freeze!','default_3x3',1,87,1,5,'1','1','0','0','catalog_freeze_en','ctlg_teaser_es','','Freeze!... and try the newest game to hit Wulles! Team up and plant snowball bombs to snap freeze your competitors. You could say it\'s so cool, it\'s frozen ;)','','','',0,''),(39,345,'pixel_collectibles','Pixel Collectables','default_3x3',1,5,1,5,'1','1','0','0','tienda-pixel','pixel3','','','','','',0,''),(40,7,'ads_room_backgrounds','Ads Room Backgrounds','default_3x3',1,47,6,0,'1','1','0','0','bg_clouds','bg_clouds','','Use these to place images in your room. The mpu\'s go to a link when clicked; the AD one does not.','','','',0,''),(41,387,'theatredome','Theatredome','default_3x3',1,264,1,25,'1','1','0','0','catalog_header_classics','article_habboreport2','','The Theatredrome is a very old and popular Public Room. It\'s hosted many campaigns from paying sponsors.','','','',0,''),(42,604,'rollers','Rollers','default_3x3',1,222,1,40,'1','1','0','0','catalog_roller_headline1','catalog_teaser_rollers_en','','Move your imagination. This cool stuff is more than suitable for business and pleasure... Habbo rollers for games and queues. Now available in multipacks.','','','',0,''),(43,209,'diner','Diner','default_3x3',1,204,1,64,'1','1','0','0','diner','catalog_diner_teaser_ens','','Originally from the 50\'s this furni has been refurbished and put right into the catalogue! Use this with the Kitchen range for ultimate diner experience!','','','',0,''),(44,209,'twilight','Twilight','default_3x3',1,62,1,204,'1','1','0','0','catalog_twilight_header_en','Fountain','','I\'ve never read the book, all I know is it has vampires playing basket ball and some heart throb called Edward Cullen, but the furni looks good!','','','',0,''),(45,219,'battle_banzai','Battle Banzai','default_3x3',1,78,1,3,'1','1','0','0','catalog_battleBanzai_header_en','banzai_teaser2','','Bigger, Better, Bouncier - it\'s Battle Banzai! Now YOU set the rules for your own game, in your own room. You got the Banzai Power!','','','',0,''),(46,253,'trax','Trax','default_3x3',1,257,1,198,'1','1','0','0','hotelhits_catalog_header','hotelhits_teaser','','Trax are the Habbo music disks which have many multiple tunes installed onto them which can be played on a Trax Machine in the room. After the Habbo transistion from Shockwave to Flash clients, the trax system was not recovered until April 2011, where only Juke Boxes, old CDs, and Habbo sold CDs were re-released.','','For decoration only.. They do not function.','',0,''),(47,526,'hello','Hello','default_3x3',1,35,1,3,'1','1','0','0','catalog_hello_header1_da','pixel3','','','','','',0,''),(48,526,'automobile','Automobile','default_3x3',1,16,1,1,'1','1','0','0','automobile_header','automobile_teaser','','','','','',0,''),(49,209,'goodbye_big_hand','Habbo History','default_3x3',1,264,1,93,'1','1','0','0','catal_fp_header','memorial','','For the nostalgic players.','','','',0,''),(50,209,'2010_bling','Bling','default_3x3',1,92,1,36,'1','1','0','0','catalog_header_bling_en','catalog_teaser_bling11','','Did someone speak in glamour? Chic? Lux? So you\'re speaking the language of Bonnie Blonde, my friend!','','','',0,''),(51,209,'organo','Organo','default_3x3',1,235,1,142,'1','1','0','0','organo_cata_header','organo_teaser','','The latest range from Ann Summers, the Orgie line. Made of soft, wipe clean plastic, its perfect for any three, four or fivesome!','','','',0,''),(52,234,'pet_food','Pet Food','default_3x3',1,201,1,2,'1','1','0','0','catalog_header_petfood','ctlg_pet_teaser1','','Keep your Pet happy and healthy. Feed it and don\'t forget about exercise!','','','',0,''),(53,209,'runway','Runway','default_3x3',1,74,1,168,'1','1','0','0','runway_header_en','runway_teaser_en','','Spice up your salon, hair parlour or boutique with our stylish yet practical range! From sewing machines to comfy seating, we\'ve got the perfect option for you.','','','',0,''),(54,209,'prison','Prison','default_3x3',1,240,1,156,'1','1','0','0','catalog_header_prison','catalog_teaser_prison','','Hey, he\'s escaping! Just kidding, no one\'s getting out of these high security cells!','','','',0,''),(55,209,'tv_studio','TV Studio','default_3x3',1,136,1,202,'1','1','0','0','header_studio','teaser_studio','','The Studio range lets YOU be your own music producer!','','','',0,''),(56,209,'cubie','Cubie','default_3x3',1,100,1,54,'1','1','0','0','catalog_cubie_header_en','catalog_cubie_teaser','','It\'s sleek, it\'s modern, it\'s so darn cool it can barely stand itself... Introducing the Cubie Furni range! Give your Bachelor or Bachelorette pad a homely feel with a sophisticated twist.','','','',0,''),(57,209,'waasa','Waasa','default_3x3',1,103,1,214,'1','1','0','0','waasa_catalogue_header','waasa_teaser','','Waasa is the perfect furniture for a chilled, laidback room. Especially good for students on a budget!','','','',0,''),(58,209,'american_idol','American Idol','default_3x3',1,4,1,6,'1','1','0','0','catalog_header_AI1_en','catalog_teaser_idol','','Host your own American Idol show with this replica furniture! All that\'s missing is a Randy Jackson lookalike!','','','',0,''),(59,209,'kitchen','Kitchen','default_3x3',1,217,1,116,'1','1','0','0','catalog_header_kitchen2015','teaser_kitchen2015','','Fancy owning a Habbo restaurant? Or just love catering for Habbos in style? With this furni line you can REALLY get cooking!','','','',0,''),(60,209,'usva','USVA','default_3x3',1,129,1,208,'1','1','0','0','catalog_header_USVA','usva_teaser','','With a great range of colours and new stacking possibilities, you\'ll love building and creating structures with the new USVA Furni line!','','','',0,''),(61,1167,'santorini_crackables','Santorini Crackables','default_3x3',1,263,1,13,'1','1','0','0','','','',NULL,NULL,NULL,NULL,0,''),(62,209,'mystics','Mystics','default_3x3',1,185,1,136,'1','1','0','0','header_mystics','teaser_mystics','','A mystic crystal has crashed outside the hotel bounds and is transforming the hotel into an infected wilderness. Will you fight for the side for good? Or will you fight for the side of evil and help the infection spread?','','','',0,''),(63,218,'triggers','Triggers','default_3x3',1,81,1,3,'1','1','0','0','catalog_wired_header2_en','ctlg_pic_wired_triggers','','Triggers let you define what needs to happen for an Effect to take place. To program a Trigger, place it in a room, double click on it and set it up! You need to stack an Effect with the Trigger to make it work.',NULL,NULL,'Click to see how each Trigger works.',0,''),(64,218,'effects','Effects','default_3x3',1,82,1,4,'1','1','0','0','catalog_wired_header3_en','ctlg_pic_wired_effects','','Effects are what happens after you activate a Trigger. To program an Effect, place it in a room, double click on it and set it up! You will always need to stack a Trigger with the Effect to make it work.',NULL,'','Click on an item to see what the Effect does!',0,''),(65,218,'conditions','Conditions','default_3x3',1,83,1,5,'1','1','0','0','catalog_wired_header4_en','ctlg_pic_wired_conditions','','Conditions are specific things that need to be done before a Trigger will work. If you want to use a Condition, you will need to stack it with a Trigger and Effect.',NULL,'','Click on an item to see what the Condition does!',0,''),(66,442,'stray_pixels','Stray Pixels','default_3x3',1,10,4,61,'1','1','0','0','StrayPixelsLogo','catalog_pxl_teaser2_nl','','','','','',0,''),(67,209,'mayan','Mayan','default_3x3',1,171,1,128,'1','1','0','0','mayan_header','mayan_teaser','','Just what you need to prove you survived the apocalypse!','','','',0,''),(68,209,'african','African','default_3x3',1,233,1,2,'1','1','0','0','african_header','african_catateaser','','The new African furniture range is here!','','','',0,''),(69,209,'anna','Anna','default_3x3',1,104,1,12,'1','1','0','0','catalog_anna_header','catalog_anna_teaser','','Make the new Anna range yours!','','','',0,''),(70,209,'steampunk','Steampunk','default_3x3',1,180,1,182,'1','1','0','0','catalog_header_steampunk','catalog_teaser_steampunk','','Infuse your room design with the power of steam! This Steampunk