k a breed:\n',0,''),(79,277,'bears','Bears','pets',1,68,1,1,'1','1','0','0','catalog_pet_headline1','','','A large mammal that walks on the soles of its feet, with thick fur and a short tail. Did you know that bears are related to dogs and that most species are omnivorous?','Name your Bear:',NULL,'Pick a breed:',0,''),(80,277,'pig','Pigs','pets',1,67,1,10,'1','1','0','0','catalog_pet_headline1','','','Finally an excuse to leave your room looking like a pigsty! Mischevious and cute, these little guys are out of the ordinary. Sweet and funny, a pet like no other!','Name your Pet Pig:','Pick a colour:','Pick a breed:\n',0,''),(81,277,'lion','Lions','pets',1,76,1,8,'1','1','0','0','catalog_pet_headline1','','','A boisterous predator in nature, the lion has been tamed to be your fierce friend in Habbo Hotel.','Name your pet:','Choose a colour:','Choose a breed:\n',0,''),(82,277,'rhino','Rhinos','pets',1,77,1,12,'1','1','0','0','catalog_pet_headline1','','','The Rhinoceros is an African herbivore that can weigh over a ton. It is proud and slightly aloof, but loyal and never let anything get in the way of a good time!','Name your pet:','Choose a colour:','Choose a breed:',0,''),(83,277,'spider','Spiders','pets',1,95,1,13,'1','1','0','0','catalog_pet_headline1','','','One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders have sharp fangs that inject venom into their prey- but don\'t worry, these spiders won\'t bite! Maybe...','','Name your pet:','',0,''),(84,277,'turtle','Turtles','pets',1,126,1,15,'1','1','0','0','catalog_pet_headline1','','','Anything but slow, these guys are ready to ride the waves and swim laps at your beaches!','','Name your Turtle:',NULL,0,''),(85,277,'chick','Chick','pets',1,107,1,3,'1','1','0','0','catalog_pet_headline1','','',NULL,'','Name your Chick:','',0,''),(86,277,'frog','Frogs','pets',1,97,1,6,'1','1','0','0','catalog_pet_headline1','','','Cute, green and slimy! Frogs come in a variety of colo