','','furni_for_colection','','','','','',0,''),(211,218,'add-ons','Add-Ons','default_3x3',1,85,1,6,'1','1','0','0','catalog_wired_header5_en','ctlg_pic_wired_support_furniture','','Use these simple Furni to bring extra spice to your Wired room. These are basic Furni, so you will still need Triggers, Effects and Conditions to make them work!','','Use Triggers, Effects and Conditions to make these Furni work!','',0,''),(212,209,'gardening','Gardening','default_3x3',1,157,1,74,'1','1','0','0','garden_catalog_header','garden_catalog_teaser','','Be at one with nature!','','','',0,''),(213,1167,'greek_crackables','Greek Crackables','default_3x3',1,263,1,7,'1','1','0','0','','','',NULL,NULL,NULL,NULL,0,''),(214,209,'stranded_jungle','Stranded Jungle','default_3x3',1,290,1,184,'1','1','0','0','catalog_header_2016jungle','junglenewfurni','','Step into a virtual world of survival, treacherous terrain and life-threatening tropical conditions... because the Stranded Jungle line is here!','','','',0,''),(215,604,'custom_rooms','Custom Rooms','default_3x3',1,125,1,10,'1','1','0','0','catalog_blackhole_header_en','catalog_blackhole_teaser','','Design your own custom room layouts with Stack Magic Tiles and Black holes. Stack your items to the ceiling or use them as dividers...the possibilities are endless!','','','',0,''),(216,209,'greek','Greek','default_3x3',1,31,1,80,'1','1','0','0','greek_header','greek_catateaser','','Be transported back to ancient Greece with a couple of thousand pounds and British Airways. Until then, build your own pantheon with our realistic Greek range!','','','',0,''),(217,209,'sports','Sports','default_3x3',1,56,1,180,'1','1','0','0','catalog_sports_headline1','catalog_sports_teaser1','','The whistle blows, but there\'s no track to practice on! Make your own before your trainer notices!','','','',0,''),(218,2,'wired','Wired','pets3',1,80,1,55,'1','0','0','0','catalog_wired_header1','ctlg_pic_teaser_wired','','','','','',0,''),(219,2,'game_shop','Game Shop','pets3',1,202,1,75,'1','0','0','0','game_shop_header','game_shop_teaser','','Get your gamer gear on!','','','',0,''),(220,2,'marketplace','Marketplace','pets3',1,69,1,90,'1','1','0','0','catalog_marketplace_header_en','catalog_note_marketplace','','Habbo Marketplace is a convenient and safe way to buy and sell items in Habbo.','How does the Habbo Marketplace work?','Buying items: Browse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you\'ll get the item at the cheapest price available at the moment of purchase. No requirements needed.\r\n\r\nSelling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on \'Sell in Marketplace\'. You also can use items currently in the Shop.\r\n\r\nNOTE: you can only sell 250 furni at a time.\r\n\r\nRequirements: To sell your Furni in the Marketplace you\'ll need a Trading Pass, which you can get completing the first steps of the Talent Track.','',0,''),(221,4,'baby_pet_animals','Baby Pet Animals','pets3',1,228,1,2,'1','1','0','0','babypets_cata_header','ctlg_babypet_note','','They\'re friendly. They\'re cute. They\'re here to win your hearts. Who are they? Baby pets! ALL NEW Kittens, puppies, piglets are storming their way through the hotel and joining the Bear Cubs and Terriers. Available via breeding boxes or sale.','A few things you should know:','*You can place a pet in your room or take one for a walk with you in other rooms.\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\n*You can have up to 50 pets in your room, but look after them all!\n\n\n*Look after your pet with food, water and treats.\nCheck the Pets\' Accessories.\n*Unlock Badges and Achievements by Training your Pet.','Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!',0,''),(222,2,'builders_club','Builder\'s Club','pets3',1,193,1,45,'1','0','0','0','block_header','ctlg_bclub_note','','1 Block... 2 Block... Red Block... Blue Block!','1 Block... 2 Block... Red\r\nBlock... Blue Block!','\r\n\r\nWith dozens of all the colours and patterns to choose from, you can really let your creativity run wild!\r\nExclusive to Builders Club.','',0,''),(223,604,'backgrounds','Backgrounds','default_3x3',1,206,1,0,'1','1','0','0','backgrounds_header','bg_clouds','','Set the scene in your room properly with one of these backgrounds.','','','',0,''),(224,604,'teleports','Teleports','default_3x3',1,120,1,55,'1','1','0','0','catalog_header_teleporters','teletransportadores3','','Beam yourself from one room to another with our space-age teleports. Buy a pair, put one in each room and you\'ve got your own suite! IMPORTANT: teleports are always sold in pairs except for the Random Banzai Teleport.','',NULL,'',0,''),(225,604,'trophies','Trophies','trophies',1,221,1,60,'1','1','0','0','trophies','','','Everyone\'s a winner, baby! And now you can reward them all with our fabulous glittering array of bronze, silver and gold trophies.\n\nFirst choose the trophy model by click the arrows. Then select the metal. Type your inscription below and we\'ll engrave it on the trophy along with your name and today\'s date.\nRemember - it\'s permanent!','','','',0,''),(226,374,'2020_alpine_heights','\'20 - Alpine','default_3x3',1,290,1,13,'1','1','0','0','alps_header','easter20_teaser','','Setting up a campsite along the river, nothing better than nature. Make your perfect campsite today!',NULL,NULL,NULL,0,''),(227,45,'how_to_play_banzai','How to Play Banzai','pets2',1,42,1,2,'1','1','0','0','catalog_battleBanzai_header_en','catalog_battleBanzai_teaser','','So how does it work? Read the instructions here and you\'ll be Banzai-ing in no time!','How to create your own \nBattle Banzai Arena:','1. In your room, place Banzai tiles on the floor and barriers the playing field\r\n\r\n2. Add a Team portal for each team (max 4: blue,\r\npink, yellow, and green)\r\n \r\n3. Place a Counter and Scoreboards on the playing field\r\n\r\n4. Click the Counter to launch the game!\r\n\r\n5.Jump on the tiles to colour them, jump 3 times to lock - team with most points win!\r\n\r\n\r\n\r\n\r\nTip: Add drama with Pyramids, Dragons and Pucks - they work as obstacles and helpers!','',0,''),(228,38,'how_to_play_freeze','How to Play Freeze!','pets2',1,42,1,4,'1','1','0','0','catalog_freeze_en','freeze3','','Find out how you can make and host your own Freeze! game by reading the instructions below!','How to play Freeze!','1. Place Tiles and Blocks in your room. Always place blocks on top of tiles! Add Team Gates, a Counter, an Exit Tile and Scoreboards.\n\n2. Ready? Let your friends choose a team. Each team can have up to five players. Then click the Counter\nto start!\n \n3. To place a Snowball, double click on the tile that you are standing on, or double click on a tile next to you. Blow up Blocks for power-ups!\n\n4. Last team standing wins!\n\n\n\n\nRemember: You will be warped to an Exit Tile when you lose all your lives.','',0,''),(229,71,'club_shop','New Club Shop','default_3x3',1,214,1,6,'1','1','0','0','catalog_header_hc','hc2016','','As a member of Habbo Club or HC, you can shop from this selection of exclusive items. Every now and then we will also be adding items that are currently unavailable in the regular Furni Shop as well!','','','',0,''),(230,680,'epic_pet','Epic Pet','default_3x3',1,42,4,8,'1','1','0','0','','','','Once purchased and placed, clicking it will give you a special pet.','','','',0,''),(231,604,'wall_decorations','Flags','default_3x3',1,286,1,15,'1','1','0','0','catalog_flags_headline1','flags_teaser','','Adorn your walls with wondrous works of art, posters, plaques and wall hangings. The Gallery is bursting with items to suit all tastes, from kitsch to cool, traditional to modern.','','','',0,''),(232,277,'pterodactyl','Pterodactyls','single_bundle',1,260,1,11,'1','1','0','0','jurassic15_catalog_header','dino_pets','','These pterrific