,'1','0','0','catalog_saddles_header2_en','sadddles','','To use a saddle, place it in a room where you have at least one Horse. Double click the saddle and select what horse you want to ride After placing the saddle you can ride your Horse by clicking on it and selecting \'Ride\'.','','','',0,''),(243,234,'dyes','Dyes','petcustomization',1,133,1,5,'1','1','0','0','catalog_horsedyes_header2_en','dyes','','Customize your horse with this selection of hair colours and body types. Each dye can also be added to your room as a piece of furniture. To use a dye place it to your room, double click on it and then select the horse you want to customise.','','','',0,''),(244,234,'hair_styles','Hair Styles','petcustomization',1,134,1,6,'1','1','0','0','catalog_horsehairstyles2_header_en','hairs','','Customize your horse and make him unique with this selection of hair styles.  Each style can also be added to your room as a piece of furniture. To use a hair style place it to your room, double click on it and then select the horse you want to customise.','','','',0,''),(245,234,'horse_jump','Horse Jump','default_3x3',1,226,1,7,'1','1','0','0','catalog_header_jumping_en','catalog_teaser_horsejump','','Take your horse jumping with these new Furni! Build a formidable race course to test your steed and your riding skills and challenge your friends!','','','',0,''),(246,4,'monster_plants','Monster Plants','pets3',1,153,1,5,'1','1','0','0','catalog_header_mopla_01','ctlg_monster_note','','Monster Plants can sure be a handful, this page gives you some extra advice on raising and looking after your monsterous brood.','Taking Care Of Your Plant','Your plants need to be tended regularly, or else they die. To ensure a healthy plant tend it every 30 hours\nor so. If it dies, you can use the Revival potion to\nbring it back to life.\nBreeding\nTo breed your plant you have to wait until it\'s fully\ngrown. Clicking Breed on the menu will show you\nwhat other plants in the room are available to breed\nwith.','',0,''),(247,246,'monster_plant_seeds','Monster Plant Seeds','default_3x3',1,156,1,1,'1','1','0','0','catalog_header_mnstrSeeds','quest_teaser_monsterplants','','Plant your seeds in your room and tend to keep them alive and healthy. After your plants have matured you can breed your plants to try and get leveled up offspring. Plants can only breed once without using the Rebreeding Potion.','','','',0,''),(248,246,'monster_plant_potions','Monster Plant Potions','default_3x3',1,155,1,2,'1','1','0','0','monsterplantsprays_header','monsterplantspray_teaser','','On this page you\'ll find everything you need to take care of your plants: Plant Revival for when your plants die. Place potion to room, double click and select the plant you want to revive.','','','',0,''),(249,209,'wedding','Wedding','default_3x3',1,238,1,216,'1','1','0','0','catalog_header_wedding','catalog_teaser_wedding','','Now you can celebrate your great day with our wonderful selection of perfect furni for a wedding!','','','',0,''),(250,763,'exotic_pets_2017','Exotic Pets','default_3x3',1,294,1,2,'1','1','0','0','catalog_pet_headline1','xotic_pets','','Gotta catch \'em all!','','','',0,''),(251,680,'cow_box','Cow Box','single_bundle',1,270,1,99,'1','1','0','0','catalog_pet_headline1','cow_pet2','','We\'re extremely pleased and proud to preent the new cow pet! Get one of 16 different breeds from the Cow Pet box','','','',0,''),(253,2,'music_shop','Music Shop','default_3x3',1,4,1,85,'1','1','0','0','music_header','catalog_djshop_teaser1','','Let\'s get loud! Place a Jukebox in your room, add some disks from the \'Habbo Hotel Hits\' list below and you\'re ready to have a dance party!','','','',0,''),(254,253,'habbo_hotel_hits','Habbo Hotel Hits','soundmachine',1,257,1,2,'1','1','0','0','hotelhits_catalog_header','hotelhits_teaser','','Turn up the volume with some cool new tunes for your room. Place a Jukebox in your room, get yourself some of these song discs and add them to your playlist!','',