  UNIQUE KEY `id` (`id`,`type`) USING BTREE,
  UNIQUE KEY `data` (`id`,`type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

